export function ManaCost(props) {
    return (
        <VStack spacing={2}>
            <HStack spacing={2}>
                <Box as="button"><i class="ms ms-w ms-cost ms-shadow" size={100}/></Box>
                <Button>Black</Button>
                <Button>Red</Button>
                <Button>Green</Button>
                <Button>Blue</Button>
            </HStack>
            <Text />    
         </VStack>
    );
}
